[[package]]
name = "agate"
version = "1.6.1"
description = "A data analysis library that is optimized for humans instead of machines."
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
Babel = ">=2.0"
isodate = ">=0.5.4"
leather = ">=0.3.2"
parsedatetime = ">=2.1"
